enum Ranking { gold, silver, bronze }

contract Arr {
    uint[] public arr;
    uint[] public arr2 = [1, 2, 3];

    function get(uint i) public view returns (uint) {
        return arr[i];
    }
}

contract ArrayRemoveByShifting {
    uint[] public arr;
    function test() external {
        arr = [1, 2, 3, 4, 5];
    }
}

